de traiter les valeurs numériques données, toutes les caractéristiques (colonne), seront discrétisées (binaire). Une fois les données nettoyées, une analyse en plusieurs points sera effectuée. La qualité de l’analyse et de la présentation sont d’égale importance.\n\nIl faut se rappeler que les données observationnelles seules ne permettent pas d\u0027établir des liens causaux. Il est impératif que votre analyse ne contienne pas de jugement de valeur. \nCollecte\nCollecter les 40 colonnes telles que spécifiées dans la section donnée. Pour chaque colonnes calculer la moyenne, la médiane, le maximum, le mode, le minimum et la variance. Il faut binariser toute les colonnes; dupliquer chacune des 40 colonnes. Pour chacune des colonnes dupliquées, remplacer les valeurs inférieures (ou égales) à la médiane par zéro et celle supérieure à la médiane par un. \nCorréaltions\nLa corrélation est toujours fonction des variables continues. Lorsque l\u0027on parle de la force d\u0027une corrélation, il s\u0027agit de la valeur absolue. Vous devez calculer le coefficient de corrélation entre chaque paire de colonnes ayant une valeur numérique. Pour chaque colonne, identifier avec quel autre colonne la corrélation est la plus forte. \nPrédictions\n(Classifieur bayésien et régression linéaire)\u000bPour toutes les questions qui suivent, vous devez utiliser les deux techniques pour effectuer des prédictions. La régression linéaire se fait avec les valeurs réelles et le classifieur bayésien  avec les valeurs binariser. \nPour chaque colonne, analyser la qualité des prédicteurs en fonction des autres colonnes. \nPour chaque colonne, identifier la paire de colonnes qui permet de la prédire avec la meilleure précision. \nTrouver les deux colonnes qui nous donnent le meilleur prédicteur pour chacune des autres caractéristiques (en moyenne).\nVisualisation et représentations\nVous devez appliquer un algorithme de réduction de dimensionnalité pour pouvoir afficher en 2 dimensions l\u0027ensemble des pays. Vous êtes libre d\u0027utiliser la technique qui vous semble la plus appropriée. Vous devez produire une image en 2 dimensions où on peut observer la position de chaque pays. La création d\u0027une image de grand format vous permettra d\u0027afficher à côté de chaque point le nom du pays même si celui-ci est relativement petit dans l\u0027image. Analyser le résultat d\u0027une réduction sur 2 dimensions et d\u0027une réduction sur 5 dimensions en essayant de trouver une interprétation aux valeurs de chacune des dimensions réduites.\nDonnées\nLa liste suivante contient une référence précise à la page, au tableau, à la colonne pour chaque caractéristique a étudier. Notez qu’il existe des outils qui permettent de faciliter le téléchargement de ce genre de tables.\n\nLorsque les valeurs sont données sous forme d\u0027intervalle,  vous devez choisir le point médian entre la limite inférieure et la limite supérieure de l\u0027intervalle. Dans les très rares cas où deux valeurs sont données, c\u0027est-à-dire lorsque différentes sources différentes valeurs, vous devez choisir le point médian. \n\nList of countries by GDP (nominal) per capita, GDP (in US$) per capita by country, United Nations, estimate.\nList of countries by Internet connection speeds, Fixed broadband, Average download speed (Mbit/s) (Ookla).\nList of countries by alcohol consumption per capita, Recorded per capita consumption of pure alcohol (litres) per adult 15 years of age and over per year, 2016.\nList of countries by intentional homicide rate, Intentional homicide victims per 100,000 inhabitants. From UNODC, rate.\nList of countries by military expenditures,  List by the Stockholm International Peace Research Institute,  % of GDP.\n"},{"ty":"as","st":"document","si":0,"ei":0,"sm":{"ds_mr":86.39999999999999,"ds_ml":86.39999999999999}},{"ty":"ae","et":"list","id":"kix.2qdefs8kdvgd","epm":{"le_nb":{"nl_4":{"b_gf":"%4.","b_ts":{"ts_un":false,"ts_un_i":false,"ts_sc":false,"ts_fgc2":{"hclr_co